import React, { Component } from 'react';
import Header from '../Header.jsx';
import Footer from '../Footer.jsx';
import {Accordion, Card, Button} from 'react-bootstrap';

class NeverlandFAQ extends Component {
	render() {
		return (
			<div>
				<div><h2>General</h2></div>
				<div>
					<Accordion defaultActiveKey="0">
						<Card>
							<Card.Header>
								<Accordion.Toggle as={Button} variant="link" eventKey="0">
									I've never grown a plant before. Is Neverland right for me?
								</Accordion.Toggle>
							</Card.Header>
							<Accordion.Collapse eventKey="0">
								<Card.Body> There’s no such thing as a black thumb. It’s normal for questions to arise such as: “How do I choose a plant? How much light does my plant need? How often do I have to water it? What happens if I forget? Is fertilizer necessary, and how often should I use it? How can I tell when I need to repot my plant? What kind of soil should I use? Why are the leaves turning brown, and where did these bugs come from?” If you’ve ever wondered about the answer to any of these questions, you’ve come to the right place. Neverland will use tech to take you step by step through the basics, teaching you how to care for—and love!—your houseplants.</Card.Body>
							</Accordion.Collapse>
						</Card>
					</Accordion>
				</div>
			</div>
			);
	}
}

export default NeverlandFAQ;
